                "Desc": "대지 위, 산맥, 반석 사이엔 바위의 힘이 널리 퍼져있다. 그러나 이 힘을 자유자재로 사용할 수 있는 이는 거의 없다.<br><br><color style='color:#FFD780;'>짧은 터치</color><br>대지에 퍼져있는 바위 원소를 소환해 암주를 생성한다.<br><br><color style='color:#FFD780;'>홀드</color><br>근처의 바위 원소를 폭발시켜 아래 효과를 생성한다:<br> · 암주의 수량이 최대 수량에 미치지 못하면 암주를 생성해 낸다.<br> · 옥홀 방패를 생성한다. 피해 흡수량은 종려 HP 최대치의 영향을 받는다.<br> · <color style='color:#FFE699;'>바위 원소 범위 피해</color>를 준다.<br> · 근처에 <color style='color:#FFE699;'>바위 원소</color>를 보유한 타깃이 있다면, 최대 2개 타깃의 <color style='color:#FFE699;'>바위 원소</color>를 대량 소모한다. 해당 효과로 피해를 줄 수 없다.<br><br><color style='color:#FFD780;'>암주</color><br>생성 시, <color style='color:#FFE699;'>바위 원소 범위 피해</color>를 준다.<br>또한 암주는 주변의 다른 <color style='color:#FFE699;'>바위 원소 창조물</color>과 간헐적으로 원암 공명을 일으켜 주변의 적에게 <color style='color:#FFE699;'>바위 원소 피해</color>를 준다.<br>암주는 <color style='color:#FFE699;'>바위 원소 창조물</color>로 간주되며, 공격을 막거나 등반할 수 있다.<br>종려가 만들어낸 암주는 초기에 동시에 1개만 존재할 수 있다.<br><br><color style='color:#FFD780;'>옥홀 방패</color><br>모든 원소 피해와 물리 피해에 대해 150%의 흡수 효과가 있다.<br>옥홀 방패로 보호를 받고 있는 캐릭터는 주변의 작은 범위 내의 적들의 원소 내성과 물리 내성을 20% 감소시킨다. 이 효과는 중첩되지 않는다.<br><br><i>바위는 옥을 갈고 금에 모양을 새길 수도 있을 만큼 단단하다</i>",
