                "Desc": "「사뿐한 회전」 상태를 발동해, 닐루의 HP 최대치에 기반하여 자신의 주변에 있는 적에게 <color style='color:#80C0FF;'>물 원소 피해</color>를 준다.<br>사뿐한 회전 상태에서 닐루가 일반 공격 또는 원소전투 스킬을 발동 시, 각각 「검의 춤」 및 「선회의 춤」으로 전환되고, 주는 피해가 다른 원소 부여 효과로 대체될 수 없는 원소전투 스킬 피해인 <color style='color:#80C0FF;'>물 원소 피해</color>로 전환된다.<br><br>해당 상태에서 닐루의 세 번째 춤은 사뿐한 회전 상태를 종료시키고, 세 번째 춤의 유형에 따라 아래의 효과를 발동한다.<br> · 검의 춤: 1줄기의 물의 달을 발동해, 물의 달에 닿은 적에게 <color style='color:#80C0FF;'>물 원소 피해</color>를 주고, 닐루에게 기도의 달 상태를 부여한다. 이런 상태에서 닐루가 일반 공격을 가하면 일반 공격이 검의 춤으로 전환되고, 최후의 일격에 물의 달을 발동한다.<br> · 선회의 춤: 1줄기의 정화의 수륜을 발동하여 <color style='color:#80C0FF;'>물 원소 범위 피해</color>를 주고, 현재 자신의 필드 위 캐릭터와 동행하는 평정의 물안개를 생성하여 범위 내의 적에게 지속적으로 <color style='color:#80C0FF;'>습기</color> 효과를 부여한다.<br><br>사뿐한 회전 또는 기도의 달 상태에서 닐루는 강공격을 사용할 수 없다. 해당 상태들은 닐루 퇴장 시 사라진다.<br><br><i>「물 위를 사뿐사뿐 걷는 그녀의 발놀림에 일렁이는 물결이 햇빛을 반사하며 반짝인다」</i>",
