                "Desc": "<color style='color:#FFD780;'>일반 공격</color><br>활로 최대 4번 공격한다.<br><br><color style='color:#FFD780;'>낙하 공격</color><br>공중에서 화살비를 쏜 후 빠른 속도로 땅에 착지한다. 착지 시 범위 피해를 준다.<br><br><color style='color:#FFD780;'>강공격</color><br>피해가 더 크고 정확한 <color style='color:#FFD780;'>조준 사격</color>을 한다.<br>조준 시 화염의 힘을 화살에 모아 발사한다. 차지 시간에 따라 각각 다른 효과를 준다:<br> · 1단 차지: 불 원소가 부착된 화살을 발사해 <color style='color:#FF9999;'>불 원소 피해</color>를 준다.<br> · 2단 차지: 트릭 화살을 발사해 <color style='color:#FF9999;'>불 원소 피해</color>를 준다. 또한 명중 후 「웃는 고양이 모자」를 1개 소환한다.<br>트릭 화살 발사 시 리니의 HP가 60%를 초과한 경우, 리니는 일부 HP를 소모해 「잔여 트릭」을 1스택 획득한다. 해당 효과는 전투 이탈 30초 후 사라진다. 최대 중첩수: 5스택<br>해당 방식으로 리니의 HP는 최대 60%까지만 감소한다.<br><br><color style='color:#FFD780;'>웃는 고양이 모자</color><br> · 주변 적을 도발해 적의 공격을 유도한다. 각 적은 웃는 고양이 모자에게 5초마다 1번만 도발당한다.<br> · 내구도는 리니의 HP 최대치를 일정 비율로 계승한다.<br> · 파괴되거나 지속 시간 종료 시 주변의 적 1명에게 <color style='color:#FFD780;'>축포탄</color>을 발사해 <color style='color:#FF9999;'>불 원소 피해</color>를 준다.<br>웃는 고양이 모자는 동시에 최대 1개까지 존재할 수 있다.<br><br><color style='color:#FFD780;'>아르케의 힘: 프뉴마</color><br>일정 시간마다 트릭 화살이 명중한 위치에 영혼의 쐐기를 내려 프뉴마 성질의 <color style='color:#FF9999;'>불 원소 피해</color>를 준다",
