                "Desc": "올려치기 공격으로 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 주고 10초 동안 지속되는 페어 카운트 상태에 진입한다.<br>페어 카운트 상태 시 원소전투 스킬은 고압 분쇄로 전환된다.<br><br><color style='color:#FFD780;'>고압 분쇄</color><br>페어 카운트의 압력 단계에 따라 각각 다른 공격을 펼치고 페어 카운트 상태를 제거한다:<br> · 0단: 세로 베기로 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 준다.<br> · 1단~3단: 세로 베기로 페어와 협동해 <color style='color:#99FFFF;'>얼음 원소 피해</color>와 물리 피해를 준다. 피해는 압력 단계에 따라 달라진다.<br> · 4단: 압력으로 가득 찬 페어의 힘으로 물리 피해를 준다. 이때 「일반 공격 · 소용돌이 검」은 고압 분쇄로 변경된다.<br><br><color style='color:#FFD780;'>페어 카운트</color><br>프레미네가 일반 공격 시, 동시에 얼음서리를 발동해 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 주고 페어 카운트의 압력 단계를 증가시킨다.<br>동시에 준 <color style='color:#99FFFF;'>얼음 원소 피해</color>는 원소전투 스킬 피해로 간주한다.<br><br><color style='color:#FFD780;'>아르케의 힘: 프뉴마</color><br>일정 시간마다 올려치기 공격 후, 올려치기 공격을 하는 영혼의 쐐기를 형성해 프뉴마 성질의 <color style='color:#99FFFF;'>얼음 원소 피해</color>를 준다.<br><br><i>상대를 죽이는 것이 아니라 행동을 방해하는 것은, 「생존」을 위해 선택한 일종의 전략이다.</i><br><i>「페어… 부탁할게」</i>",
