                "Desc": "파티 내 캐릭터가 결정 반응으로 생성된 결정 조각을 획득할 시 나비아가 「결정 파편」을 1개 획득한다. 「결정 파편」은 최대 6개까지 획득할 수 있고, 발동할 때마다 보유한 「결정 파편」의 지속 시간이 갱신된다.<br>발동 시 나비아는 모든 「결정 파편」을 소모해 우아하면서도 치명적인 우산총을 펼치고, 적을 꿰뚫는 「장미탄」을 여러 발 발사해 명중한 적에게 <color style='color:#FFE699;'>바위 원소 피해</color>를 준다.<br>0/1/2/3개 또는 그 이상의 「결정 파편」 소모 시, 각각 「장미탄」을 5/7/9/11개씩 발사한다. 동일한 적에게 명중한 「장미탄」이 많을수록 해당 적에게 주는 피해가 증가한다. 「장미탄」 11개가 모두 명중하면 기존의 200%에 해당하는 피해를 준다.<br>또한, 「결정 파편」을 3개 넘게 소모할 경우, 3개를 초과한 「결정 파편」 1개당 이번 사격으로 주는 피해가 추가로 15% 증가한다.<br><br><color style='color:#FFD780;'>홀드</color><br>조준 상태로 진입해 결정 반응으로 생성된 주변의 결정 조각을 지속적으로 획득하고 홀드 종료 시 짧은 터치와 동일한 「장미탄」을 발사한다.<br><br>초기 사용 가능 횟수: 2회.<br><br><color style='color:#FFD780;'>아르케의 힘: 우시아</color><br>일정 시간마다 나비아가 우산총으로 사격 시 솟구치는 칼날을 소환해 우시아 성질의 <color style='color:#FFE699;'>바위 원소 피해</color>를 준다.<br><br><i>「거리를 유지해야 할 사람과 적당한 거리를 두는 건 사교 예절 중의 하나야. 하지만 그것도 여러 가지 방법이 있지…」</i>",
