                        "Desc": "This art of Dehya's own invention changes its method of use depending on the combat situation.<br><br><color style='color:#FFD780;'>Indomitable Flame</color><br>This skill will be unleashed should there be no Fiery Sanctum field created by Dehya herself present at the time.<br>Deals <color style='color:#FF9999;'>AoE Pyro DMG</color>, and creates a field known as Fiery Sanctum.<br><br><color style='color:#FFD780;'>Ranging Flame</color><br>This skill will be unleashed should a Fiery Sanctum field created by Dehya herself already exist.<br>Dehya will perform a leaping attack, dealing <color style='color:#FF9999;'>AoE Pyro DMG</color> before recreating a Fiery Sanctum field at her new position.<br>A Fiery Sanctum field created this way will inherit the remaining duration of the previous field.<br><br>Ranging Flame can be used only once throughout a single Fiery Sanctum field's duration.<br><br><color style='color:#FFD780;'>Fiery Sanctum</color><br>When an opponent within a Fiery Sanctum field takes DMG, the field will unleash a coordinated attack, dealing <color style='color:#FF9999;'>AoE Pyro DMG</color> to them based on Dehya's ATK and Max HP. This effect can be triggered once every 2.5s.<br>Active characters within this field have their resistance to interruption increased, and when such characters take DMG, a portion of that damage will be mitigated and flow into Redmane's Blood. Dehya will then take this DMG over 10s. When the mitigated DMG stored by Redmane's Blood reaches or goes over a certain percentage of Dehya's Max HP, she will stop mitigating DMG in this way.<br><br>Only 1 Fiery Sanctum created by Dehya herself can exist at the same time.<br><br><i>Walk this fiery ordeal with me and purge all impurity, just as a beast of flames that must descend from the blaze.</i>",
