                        "Desc": "Unleashing her burning anger and casting her inconvenient blade aside, Dehya enters the Blazing Lioness state and increases her resistance to interruption.<br>In this state, Dehya will automatically and continuously unleash the Flame-Mane's Fists, dealing <color style='color:#FF9999;'>Pyro DMG</color> based on her ATK and Max HP, and when its duration ends, she will unleash an Incineration Drive, dealing <color style='color:#FF9999;'>AoE Pyro DMG</color> based on her ATK and Max HP.<br>If a Fiery Sanctum field created by Dehya's own Elemental Skill \"Molten Inferno\" exists when this ability is unleashed, Dehya will retrieve it, and then create another field once Blazing Lioness's duration expires. This field will take on the retrieved field's duration at the moment of its retrieval.<br>In this state, Dehya will be unable to cast her Elemental Skill, or perform Normal, Charged, and Plunging Attacks. \"Normal Attack: Sandstorm Assault\" and Elemental Skill \"Molten Inferno\" will be replaced by \"Roaring Barrage.\"<br><br><color style='color:#FFD780;'>Roaring Barrage</color><br>Unleashing Roaring Barrage within 0.4s after each Flame-Mane's Fist strike will increase the speed at which the next Flame-Mane's Fist strike will be triggered.<br><br><i>Even the flowing flames must obey her rage and at her command become her fangs and claws.</i>",
